(function() {
  var FILE_SUFFIX, HOMEDIR, IS_COFFEE, IS_INSTRUMENTED, LIB_DIR, PHONY, argv, count, i, method, phony;

  HOMEDIR = __dirname + "/..";

  IS_COFFEE = process.argv[0].indexOf("coffee") >= 0;

  IS_INSTRUMENTED = (require('path')).existsSync(HOMEDIR + '/lib-cov');

  LIB_DIR = IS_INSTRUMENTED ? HOMEDIR + "/lib-cov" : HOMEDIR + "/lib";

  FILE_SUFFIX = IS_COFFEE ? ".coffee" : ".js";

  PHONY = LIB_DIR + "/phony" + FILE_SUFFIX;

  argv = require('optimist')["default"]("count", 1)["default"]("method", "name")["default"]("return", "string").argv;

  phony = require(PHONY).make_phony();

  method = phony[argv.method];

  count = argv.count;

  for (i = 0; 0 <= count ? i < count : i > count; 0 <= count ? i++ : i--) {
    console.log(method({
      "return": argv["return"]
    }));
  }

}).call(this);
